   constructor(props){
      super(props)
      this.state = { 
         open: false,
         city: false,
         city3: false,

         openINFO: true
      }
      
      // this.openINFOcenter = this.openINFOcenter.bind(this);
      // this.closeINFOcenter = this.closeINFOcenter.bind(this);
   }
